k up some of the darker tones in the brick and.";i:31;s:31:"Look at the color of the brick.";i:32;s:130:"If you notice that one color seems prominent in the brick such as tan or white flecks you can use that color for your garage door.";i:33;s:111:"In a twist on a monochromatic color scheme you can choose a garage door that is the primary color of the brick.";i:34;s:38:"Choosing the Right Garage Door Finish.";i:35;s:97:"Choosing the right garage door finish or color can have a major impact on your homes curb appeal.";i:36;s:159:"A garage door doesnt have to be a boring utilitarian part of the houseit can be anything from a warm and inviting wood focal point to a sleek modern showpiece.";i:37;s:25:"Contrasting Garage Doors.";i:38;s:99:"Favorite contrasting garage door colors for brick homes included green purple blue white and black.";i:39;s:114:"Especially for red brick homes these bold cooler colors contrast nicely with the warm and rich tones in the brick.";i:40;s:75:"American Overhead Door suggests focusing on one of the colors in the brick.";i:41;s:130:"If you notice that one color seems prominent in the brick such as tan or white flecks you can use that color for your garage door.";i:42;s:105:"The company also notes For the most part a rich chocolate brown or deep bronze will pair well with brick.";i:43;s:84:"Some popular features for Tan Garage Doors are insulated with windows and paintable.";i:44;s:56:"What is the top-selling product within Tan Garage Doors.";i:45;s:86:"The top-selling product within Tan Garage Doors is the Clopay Gallery Collection 8 ft.";i:46;s:61:"65 R-Value Insulated Desert Tan Garage Door with SQ24 Window.";i:47;s:51:"What are the shipping options for Tan Garage Doors.";i:48;s:52:"Some Tan Garage Doors can be shipped to you at home.";i:49;s:49:"White is the most popular color for garage doors.";i:50;s:58:"Sarah Fisher vice president of marketing and design at HA.";i:51;s:117:"Fisher Homes told Fagan Door a Rhode Island garage door compan